import './Section2.css'

function Section2(){

    return(
        <div id='section2'>
            <div className='vidContainer'>
                <video src="Video/Yacht.mp4" autoPlay={true} loop={true} controls={false} playsInline muted></video>
            </div>
            <ul className='list' id='firstList'>
                <li className=''><p><strong>Capacity</strong> of 200</p></li>
                <li><p><strong>Size</strong> 560 ft/sq</p></li>
                <li><p>Other 560 ft/sq</p></li>
            </ul>
        </div>
    )
}

export default Section2;
